description:
Peep Show [WebDl].mp4

Tony is a landlord with tiny little video cameras in all the bedrooms and bathrooms of each of his four apartments. He
watches his beautiful, single female tenants have sex, shower, go to the bathroom, you name it. His is a helplessly addicted voyeur,
unable to stop even though he knows that what he's doing is &quot;wrong&quot;. And then came Allie and everything changed. Instead of simply
jerking off to his hot new resident, he finds himself falling in love with her. He no longer watches any other camera; all he thinks about
is Allie. One night she brings home a man from a bar, and while watching he gets so jealous that he turns away. What used to give
him pleasure -- his hidden cameras -- now tortures him. Vivid presents Peep Show, the story of a tortured watcher and his beautiful
subject...and what happens when he really goes in for the closeup.

Allie Haze, Giselle Leon, Indigo Augustine, Jessie Andrews, Liza Del Sierra

Feature, Straight

